import React from "react";

interface Props {
  items: {
    id: string;
    text: string;
  }[];
  onDelete
}

const TodoList: React.FC<Props> = (props) => {
  return (
    <ul>
      {props.items.map((e) => (
        <li key={e.id}>{e.text}</li>
      ))}
    </ul>
  );
};

export default TodoList;
